<?php

use privuma\privuma;
use privuma\helpers\mediaFile;
use privuma\helpers\cloudFS;
use MediaCrypto\MediaCrypto;

require_once(__DIR__ . DIRECTORY_SEPARATOR . '..' . DIRECTORY_SEPARATOR . '..' . DIRECTORY_SEPARATOR . '..' . DIRECTORY_SEPARATOR . 'app' . DIRECTORY_SEPARATOR . 'privuma.php');

$privuma = privuma::getInstance();
$downloadLocation = $privuma->getEnv('DOWNLOAD_LOCATION');
if(!$downloadLocation){
    exit();
}

$conn = $privuma->getPDO();

$ops = new cloudFS($downloadLocation, true, '/usr/bin/rclone', null, true);
echo PHP_EOL."Building list of media to download";
$stmt = $conn->prepare("select filename, album, time, hash, url, thumbnail
from media
where hash in
(select hash from media where hash is not null and hash != '' and hash != 'compressed')
and dupe = 0
group by hash
 order by
    time DESC");
$stmt->execute();
$dlData = $stmt->fetchAll();

echo PHP_EOL."Building web app payload of media to download";
$stmt = $conn->prepare("SELECT json_group_array( json_object('filename', substr(filename,-10), 'album',album, 'dupe',dupe,'time',time,'hash',hash)    ) AS json_result FROM (SELECT * FROM media WHERE hash is not null and hash != '' and hash != 'compressed' ORDER BY id)");
$stmt->execute();
$mobiledata = $stmt->fetchAll()[0]["json_result"];
$stmt = $conn->prepare("SELECT json_group_array( json_object('filename', substr(filename,-10), 'album',album, 'dupe',dupe,'time',time,'hash',hash, 'metadata', metadata)    ) AS json_result FROM (SELECT * FROM media WHERE hash is not null and hash != '' and hash != 'compressed' ORDER BY id)");
$stmt->execute();
$data = str_replace('`', '', $stmt->fetchAll()[0]["json_result"]);
$data = json_decode($data, true);
foreach($data as $index => $media) {
    if ($media["metadata"]) {
        $media["metadata"] = json_decode($media["metadata"], true);
        $media["metadata"] = [
            "author" => $media["metadata"]["author"] ??  $media["metadata"]["artist"] ?? '',
            "date" => $media["metadata"]["date"] ?? $media["metadata"]["updated"] ?? $media["metadata"]["created"] ?? '',
            "title" => $media["metadata"]["title"] ?? $media["metadata"]["name"] ?? '',
            "description" => $media["metadata"]["description"] ?? '',
            "tags" => $media["metadata"]["tags"] ?? $media["metadata"]["keywords"] ?? [],
            "userRating" => $media["metadata"]["userRating"] ?? (round(($media["metadata"]["favorites"] / $media["metadata"]["views"]) * 100, 4)) ?? 100,
            "comments" => array_map(function($comment) {
                $comment["content"] = preg_replace('/\W/',' ', $comment["content"]);
                return $comment;
            }, ($media["metadata"]["comments"] ?? [])),
        ];
        $data[$index]["metadata"] = json_encode($media["metadata"]);
    }
}
$data = json_encode($data);

echo PHP_EOL."Building CSV database copy of media to download";
$stmt = $conn->prepare("SELECT filename,album,hash,dupe,time,metadata FROM `media` WHERE hash is not null and hash != '' and hash != 'compressed' ");
$stmt->execute();
$csv = "filename,album,hash,dupe,time,metadata\r\n";
while ($row = $stmt->fetch()) {
  $csv .= implode(",", [$row["filename"], $row["album"], $row["hash"], $row["dupe"], $row["time"], $row["metadata"]]);
  $csv .= "\r\n";
}

echo PHP_EOL."All Database Lookup Operations have been completed.";

