/**
 * AES JSON formatter for CryptoJS
 * @link https://github.com/brainfoolong/cryptojs-aes-php
 * @version 2.1.1
 */

var CryptoJSAesEnc = {
  /**
   * Encrypt any value
   * @param {*} value
   * @param {string} password
   * @return {string}
   */
  'encrypt': function (binary, password) {
    return CryptoJS.AES.encrypt(binary, password, { format: CryptoJSAesEnc }).toString()
  },
  /**
   * Decrypt a previously encrypted value
   * @param {string} jsonStr
   * @param {string} password
   * @return {*}
   */
  'decrypt': function (yencrypted, password) {
    return CryptoJS.AES.decrypt(yencrypted, password, { format: CryptoJSAesEnc });
  },
  /**
   * Stringify cryptojs data
   * @param {Object} cipherParams
   * @return {string}
   */
  'stringify': function (cipherParams) {
    var j = {}
    if (cipherParams.iv) j.iv = cipherParams.iv.toString()
    if (cipherParams.salt) j.salt = cipherParams.salt.toString()
    return JSON.stringify(j).replace(/\s/g, '') + "\n" +  cipherParams.ciphertext.toString((data) => z85.encode(w2a(data)));
  },
  /**
   * Parse cryptojs data
   * @param {string} jsonStr
   * @return {*}
   */
  'parse': function (payload) {
    var pieces = payload.split(/\n(.*)/s);
    var j = JSON.parse(pieces[0]);
    var cipherParams = CryptoJS.lib.CipherParams.create({ciphertext: a2w(z85.decode(pieces[1]))});
    if (j.iv) cipherParams.iv = CryptoJS.enc.Hex.parse(j.iv)
    if (j.salt) cipherParams.salt = CryptoJS.enc.Hex.parse(j.salt)
    return cipherParams
  }
}


function isJsonString(str) {
    try {
        JSON.parse(str);
    } catch (e) {
        return false;
    }
    return true;
}

function isencrypted(str) {
  return str.charAt(0) === "{" && str.charAt(str.length - 1) === "}";
}

let medcrypt = {
      isImage: function(resource) {
        var re = /(?:\.([^.]+))?$/;
        var ext = re.exec(resource)[1];
        return ['jpg','jpeg','gif','png'].includes(ext);
      },
      isVideo: function(resource) {
        var re = /(?:\.([^.]+))?$/;
        var ext = re.exec(resource)[1];
        return ['mp4','webm'].includes(ext);
      },
      maxTries: 3,
      getSrc: function(resource, tries = 0) {
        return new Promise((resolve, reject) => {
          fetch(resource, {
              headers: {
                'content-type': 'text/plain;charset=UTF-8',
                'range': 'bytes=0-10'
              },
          })
          .then(response => {
            return response.text();
          })
          .then(start => {
              if(start[0] === '{') {
                // it looks like a json file and is likely encrypted
                fetch(resource)
                .then(response => new Promise((pass, deny) => {
                    let fetchReader = response.body.getReader(),
                      decoder = new TextDecoder(),
                      salts = "",
                      currentLineData = "",
                      blobs = [];
                    return fetchReader.read()
                      .then(function processRead({done, value}) {
                        if(done === true) {
                          // Get the total length of all arrays.
                          let length = 0;
                          blobs.forEach(item => {
                            length += item.length;
                          });

                          // Create a new array with total length and merge all source arrays.
                          let mergedArray = new Uint8Array(length);
                          let offset = 0;
                          blobs.forEach(item => {
                            mergedArray.set(item, offset);
                            offset += item.length;
                          });

                          return pass(
                            window.URL.createObjectURL(
                              new Blob(
                                [mergedArray.buffer],
                                {type: response.headers.get("Content-Type")}
                              )
                            )
                          );
                        }
                        decoder.decode(
                            value,
                            { stream: !done }
                        ).split("\n").forEach((line) => {
                          if(isJsonString(line)) {
                            salts = line;
                          }else{
                            if(!isencrypted(currentLineData)) {
                              currentLineData += line;
                            }
                            if (isencrypted(currentLineData)) {
                              let bytes = CryptoJSAesEnc.decrypt(salts + "\n" + currentLineData.substring(1, currentLineData.length-1), passphrase);
                              blobs.push(w2a(bytes));
                              currentLineData = "";
                            }
                          }
                        });
                      return fetchReader.read().then(processRead).catch(deny);
                    }).catch(deny);
                })
            )
            .then((blobUrl) => {
              resolve(blobUrl);
            }).catch(reject);
          } else {
            resolve(resource);
          }
        }).catch(reject);
      }).then((success) => {
    	return Promise.resolve(success);
      }).catch((reject) => {
    	return (tries + 1 < medcrypt.maxTries)
    		? medcrypt.getSrc(resource, tries + 1)
    		: Promise.reject(reject);
      });
    }
  };

function normalizeComments(comments) {
	return comments.map((comment) => {
    if(comment.comments.length > 0) {
      comment.comments = normalizeComments(comment.comments);
    }
    return {
    	author: comment.username || 'Unknown',
      date: new Date(comment.date),
      message: comment.content.replace(/\W/g, ' '),
      comments: comment.comments,
    };
  })
}

function mapComments(comments) {
  let newcomments = comments.map((comment) => {
  	return { ...comment, comments: []};
  });
  let descendents = newcomments.filter((comment) => comment.parent_cid != null);
  descendents.forEach((descendent) => {
    	const parent = newcomments.findIndex((com) => com.cid === descendent.parent_cid);
      if(parent > -1) {
      	newcomments[parent].comments.push(descendent);
      }
  });
  return normalizeComments(newcomments.filter((comment) => comment.parent_cid == null));
}

function normalizeMeta(meta) {
  return {
    author: meta.author || meta.artist || '',
    date: new Date(meta.date) || new Date(meta.updated) || '',
    title: meta.title || meta.name || '',
    description: meta.description || '',
    tags : meta.tags || meta.keywords || [],
    rating: meta.userRating || (Math.floor((meta.favorites / meta.views) * 100000) / 1000) || 100,
    comments: mapComments(meta.comments || []),
  }
}

function buildCommentsDom(comments) {
	let output = '';
  comments.forEach((comment) => {
  	output += `<div class="comment" style="width:100%;"><h4>${comment.author}</h4><h5>${comment.date}</h5><p>${comment.message}</p><div class="indent" style="margin-left:5%;width:95%;">`;
    output += buildCommentsDom(comment.comments);
    output += `</div></div>`;
  });
    return output;
}

function buildDom(meta) {
	let output = '';
  	output += `<div class="meta"><h2>${meta.author}</h2><h3>${meta.title}</h3><h4>${meta.date}</h4><h4>${meta.rating}</h4><h4>${meta.tags.join(', ')}</h4><p>${meta.description}</p></div>`;
    output += buildCommentsDom(meta.comments);
    return output;
}

